import { useEffect, useState } from 'react';
import DocumentEditor from './components/DocumentEditor';
import './index.less';
import { Container } from '@/components/Atoms';
import { base64ToText } from '@/utilities/file';
import { isUsingUriEncoded } from '@/utilities/string';

const DemoDocFormat = () => {
  const [documentData, setDocumentData] = useState<Record<string, any> | string>('');

  useEffect(() => {
    const rawData = "";
    const documentRawContent = base64ToText(rawData);
    let bieuMau = {};

    if (isUsingUriEncoded(base64ToText(rawData))) {
      bieuMau = JSON.parse(decodeURIComponent(documentRawContent));
    } else {
      bieuMau = JSON.parse(documentRawContent);
    }
    const dataImport = {
      "dviQuanLy": "PHNG PA09",
      "dviCapTren": "CATP H NI",
      "thanhPho": "H Ni",
      "diaDiem2": "H Ni",
      "tenCB": "Phm Ngc Linh",
      "dviCB": "i iu tra 2: i iu tra n khc, PA09, Cng an thnh ph H Ni",
      "capBacCB": "Thiu t",
      "chucVuCB": "Cn b",
      "sdtCB": "0988888888",
      "taiKhoan": "linhpn500780"
    };

    setDocumentData(dataImport ? renderBieuMau(bieuMau as Record<string, any>, dataImport) : bieuMau);

    //#region Phn load api demo
    // const currentUrl = new URL(window.location.href);
    // const id = currentUrl.searchParams?.get('id');
    // const accessToken = currentUrl.searchParams?.get('auth');
    // let url = `https://daotao.csdlnv.v06.bca/v1/dths2/van-ban/export/${id}/pdf`;
    // url = `/van-ban/export/${id}/doc`;

    // if (accessToken) {
    //   localStorage.setItem(LOCAL_STORAGE.ACCESS_TOKEN, `Bearer ${accessToken}`);
    // }

    // loadSfdt(url);
    //#endregion

  }, []);

  // async function loadSfdt(url: string) {
  //   const res = await dthsHttp.downloadFile({ url, data: {} }, { manual: true });
  //   const blob = new Blob([res?.data], {
  //     type: 'application/docx'
  //   });
  //   console.log('loadSfdt', blob);
  // }

  //#region helper
  function renderBieuMau(template: Record<string, any>, data: Record<string, string>) {
    for (const key in template) {
      if (typeof template[key] === 'object') {
        renderBieuMau(template[key], data);
      } else if (typeof template[key] === 'string') {
        const keys = Object.keys(data);
        for (const field of keys) {
          if ((template[key] as string).includes(field)) {
            template[key] = (template[key] as string).replace(field, data[field]);
            break;
          }
        }
      }
    }

    return template;
  }
  //#endregion


  return (
    <Container className='dashboard'>
      {/* <div className='p-4 flex flex-col gap-4 h-full'> */}
      <div className='flex flex-col justify-between h-full w-full'>
        <DocumentEditor
          documentData={(documentData as Record<string, any>)?.json ?? ''}
          initDataExport={{}}
          currentUser=''
          onSave={() => {}}
          readOnly={false}
          enableTrackChanges={true}
          collapse={false}
        />
      </div>
      {/* <div className='overflow-auto'></div> */}
      {/* </div> */}
    </Container>
  );
};

export default DemoDocFormat;
